const sharp = require('sharp');

async function overlayImages() {
    // Base64 encoded overlay image

    const overlayBase64 = `data:image/png;base64,`

    // Load the background image
    const background = sharp('my-initials.png');

    // Get the dimensions of the background image
    const backgroundMetadata = await background.metadata();

    // Decode the Base64 string to a buffer
    const overlayBuffer = Buffer.from(overlayBase64.split(',')[1], 'base64');

    // Resize the overlay image to fit within the background dimensions
    const resizedOverlay = await sharp(overlayBuffer)
        .resize(backgroundMetadata.width, backgroundMetadata.height, {
            fit: 'inside',
            withoutEnlargement: true
        })
        .toBuffer();

    // Composite the resized overlay image onto the background image
    const result = await background
        .composite([{ input: resizedOverlay, top: 0, left: 0 }])
        .toFile('result.png');

    console.log('Image saved as result.png');
}

overlayImages().catch(err => {
    console.error(err);
});

